import React, { Component } from 'react';
import gql from "graphql-tag";
import {graphql} from 'react-apollo';

const TodosQuery = gql`
{
  todos{
    id
    text
    complete
  }
}
`;

class App extends Component {
  render() {
    return <div>Hello</div>
  }
}

export default App;
